function Listas({itens}){
    return(
        <div>
            <h3>Lista de Coisas Boas</h3>
            {itens.length > 0 ? (
            itens.map((item, index) =>(
                    <p key={index}>{item}</p>
            )))
            :(
                <p>N/A</p>
            )}
        </div>
    )
}
